import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import '../Login/Login.css';
import { Link } from 'react-router-dom';
imp


function Login() {
  return (
    <div className="lognbg">

      <div className="logbg ">

        <div className='login mt-5'>
          <span className='title text-warning'>Login</span>

          <form action="" className='formdata mt-5'>

            <input type="text"
              placeholder='Username'
              name='username'
              className='user' />
            <br />

            <input type="password"
              placeholder='Password'
              className='pass m-3' />
            <br />

            <a href='' className='forget text-white'>forget password?</a>
            <br />
            <span className='remember text-white'><input type="checkbox" /> Remember me</span><br />

            <button className='logbtn mt-5'>Login</button><br />
            <div className='noacc text-white mt-4'>
            <span >Have no account ? <a href="" className='signpg text-white'>sign up!</a></span>
            </div>
          </form>  
        </div>
     </div>
    </div>
  );
}

export default Login;
